const image = new Canvas.Image(
	images.girl,
	canvas.width/2-adjust(1729)/x/2,
	canvas.height-adjust(1744)/x-254,
	adjust(1729)/x,
	adjust(1744)/x,
	0,0,
	1729,1744
);

const background2 = new Canvas.Image(
	images.bg,
	0,
	image.y/1.25,
	adjust(1500),
	adjust(496),
	0,0,
	1500,496
);

const light = new Canvas.Rect(0,0,canvas.width,canvas.height,{color:"#000000"});
light.alpha = 0.5;

canvas.add(background1);
canvas.add(background2);
canvas.add(moon);
canvas.add(image);
canvas.add(light);

let renderParts = 0;
const maxParts = 1000;

var particles = [];
for(let x = 0; x < maxParts; x++) {
	particles.push({
		x: Math.random() * canvas.width,
		y: Math.random() * canvas.height,
		l: Math.random() * 1,
		xs: -4 + Math.random() * 4 + 2,
		ys: Math.random() * 10 + 10
	})
}

const ctx = canvas.context;

function update(ts){
	canvas.clear();
	canvas.render();
	
	ctx.strokeStyle = '#ff0000';
	ctx.lineWidth = 1;
	ctx.lineCap = 'round';
	
	for(let x in particles) {
		if(x>=renderParts)break;
		var p = particles[x];
		ctx.beginPath();
		ctx.moveTo(p.x, p.y);
		ctx.lineTo(p.x + p.l * p.xs, p.y + p.l * p.ys);
		ctx.stroke();
	}
	
	for(let x in particles) {
		var p = particles[x];
		p.x += p.xs;
		p.y += p.ys;
		if(p.x > canvas.width || p.y > canvas.height) {
			p.x = Math.random() * canvas.width;
			p.y = -20;
		}
	}
	if(renderParts < maxParts)renderParts++;
	
	requestAnimationFrame(update);
}

requestAnimationFrame(update);
